import React, { useState, useEffect } from 'react';
import { getGuestDashboard, searchReports } from '../services/api';
import { Link } from 'react-router-dom';
import '../styles/GuestDashboard.css';

const GuestDashboard = () => {
  const [reports, setReports] = useState([]);
  const [searchQuery, setSearchQuery] = useState('');
  const [loading, setLoading] = useState(true);

  useEffect(() => {
    fetchReports();
  }, []);

  const fetchReports = async () => {
    try {
      const response = await getGuestDashboard();
      setReports(response.data);
    } catch (error) {
      console.error('Error fetching reports:', error);
    } finally {
      setLoading(false);
    }
  };

  const handleSearch = async (e) => {
    e.preventDefault();
    try {
      const response = await searchReports(searchQuery);
      setReports(response.data);
    } catch (error) {
      console.error('Error searching:', error);
    }
  };

  if (loading) return <div className="loading-container">Loading...</div>;

  return (
    <div className="guest-dashboard">
      {/* Header matching the image */}
      <div className="d-flex justify-content-between align-items-center mb-4">
        <h1>Student Dashboard</h1>
        <div className="d-flex align-items-center">
          <span className="welcome-text">Welcome, leeto</span>
          <div>
            <Link to="/login" className="btn btn-primary me-2">Login</Link>
            <Link to="/register" className="btn btn-outline-primary">Register</Link>
          </div>
        </div>
      </div>

      {/* Main Content */}
      <div className="guest-dashboard-content">
        <div className="card">
          <div className="card-header">
            <h3>Recent Lecture Reports</h3>
            <form onSubmit={handleSearch} className="d-flex mt-3">
              <input
                type="text"
                className="form-control me-2"
                placeholder="Search reports..."
                value={searchQuery}
                onChange={(e) => setSearchQuery(e.target.value)}
              />
              <button type="submit" className="btn btn-primary">Search</button>
            </form>
          </div>
          <div className="card-body">
            {reports.length === 0 ? (
              <div className="empty-state">
                <p>No reports available.</p>
              </div>
            ) : (
              <div className="table-responsive">
                <table className="table table-striped">
                  <thead>
                    <tr>
                      <th>Course</th>
                      <th>Lecturer</th>
                      <th>Class</th>
                      <th>Topic</th>
                      <th>Date</th>
                    </tr>
                  </thead>
                  <tbody>
                    {reports.map((report) => (
                      <tr key={report.id}>
                        <td>{report.course_name}</td>
                        <td>{report.lecturer_name}</td>
                        <td>{report.class_name}</td>
                        <td>{report.topic_taught}</td>
                        <td>{new Date(report.date_of_lecture).toLocaleDateString()}</td>
                      </tr>
                    ))}
                  </tbody>
                </table>
              </div>
            )}
          </div>
        </div>
      </div>
    </div>
  );
};

export default GuestDashboard;
